import { StyleSheet } from "react-native-web";

const LoginStyles = StyleSheet.create({

    // -------------------

    all_container: {
        width: '100vw',
        height: '100vh',

        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',

        border: '4px solid black',
    },

    // -------------------

    login_container: {
        width: 'auto',
        height: 'auto',

        margin: '10px',
        padding: '10px',

        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        
        border: '3px solid black',
    },

    login_content_container: {
        margin: '10px',
        padding: '10px',
        
        border: '2px solid black',
    },
 
    // -------------------

    image_login: {
        backgroundColor: '#FFFFF',
    },

    // -------------------

    input_container: {
        margin: '10px',
        padding: '10px',
        
        border: '1px solid black',
    },

    inputs: {
        margin: '10px',
    },

    // -------------------

    button_container: {
        margin: '10px',
        padding: '10px',

        border: '1px solid black',
    },

    buttons: {
        margin: '5px',
    },

    // -------------------


    // ------------------- ( Contenedor del input de contraseña y icono para ver contraseña )

    input_password: {
        display: 'flex',
        flexDirection: 'row',
        width:  '520px',
    },

    input_icon: {
        top: '5px',
        left: '6px',
       
    },

    // ------------------- ( Contenedor de los botones y estilos de los botone

})
export {LoginStyles}
